import { useState } from 'react'
import './App.css';


async function getExp(stlvl,endlvl,type){
  await fetch('/exp/'+stlvl+'/'+endlvl+'/'+type)
  .then(response => response.json())
  .then(data => console.log(data));
}

function App() {


  return (
    <div className="App">

      <input type="number" id="stlvl"></input>
      <input type="number" id="endlvl"></input>
      <button onClick={() => getExp(document.getElementById("stlvl").value,document.getElementById("endlvl").value)}> Get Exp </button>
    </div>
  );
}

export default App;
